# REM: imageArray[][]

f = open("Header.s","w")

f.write("printHeaderWidth:\n")
f.write("    dc.w    {}\n".format(len(imageArray[0])))

f.write("printHeaderHeight:\n")
f.write("    dc.w    {}\n".format(int(len(imageArray)/8)))

f.write("printHeaderGraphicDataString:\n")
f.write("    dc.b    0x1b\n")
f.write("    .ascii  \"G{:0>4d}\"\n".format(len(imageArray[0])))
f.write("    dc.b    0\n")

f.write("\n    .even\n\nprintHeaderStart:\n")

# step through rows
for y in range(0, len(imageArray), 8):
	lineStr = "    dc.b    "
	# step through columns
	for x in range(0, len(imageArray[0])):
		lineStr += "0b"
		lineStr += "{}".format(imageArray[y+7][x])
		lineStr += "{}".format(imageArray[y+6][x])
		lineStr += "{}".format(imageArray[y+5][x])
		lineStr += "{}".format(imageArray[y+4][x])
		lineStr += "{}".format(imageArray[y+3][x])
		lineStr += "{}".format(imageArray[y+2][x])
		lineStr += "{}".format(imageArray[y+1][x])
		lineStr += "{}".format(imageArray[y+0][x])
		if x < len(imageArray[0])-1:
			lineStr += ","
	lineStr += "\n"
	f.write(lineStr)
f.write("printHeaderEnd:\n")
f.close()